  ex:catherine_thompson ex:isAncestorOf ex:sarah_lockey_1848 .
}
"""

def query_ontology(query):
    # Simulating a query to the ontology based on the given context
    # The actual implementation would depend on how the ontology is stored or accessed
    individuals = {
        "ex:catherine_thompson": {"ex:isMotherOf": ["ex:eden_georgina_gardner_thompson_1810"]},
        "ex:eden_georgina_gardner_thompson_1810": {"ex:isMotherOf": ["ex:sarah_lockey_1848"]},
    }
    query = query.replace("PREFIX ex: <http://www.example.com/genealogy.owl#>", "").strip()
    if query.startswith("ASK"):
        query = query.replace("ASK {", "").replace("}", "").strip()
        parts = query.split()
        subject = parts[0]
        predicate = parts[1]
        object = parts[2].replace(".", "")

        if predicate == "ex:isAncestorOf":
            return is_ancestor_of(individuals, subject, object)
        else:
            return False
    else:
        return False

def is_ancestor_of(individuals, subject, object):
    # Simplified logic to check if subject is an ancestor of object
    # This would typically involve a more complex query or traversal of the ontology
    if subject not in individuals or object not in individuals:
        return False

    # Direct parent check
    if object in [x.replace("ex:", "") for x in individuals.get(subject, {}).get("ex:isMotherOf", [])]:
        return True

    # Indirect ancestor check (simplified)
    for child in individuals.get(subject, {}).get("ex:isMotherOf", []):
        if is_ancestor_of(individuals, child, object):
            return True

    return False

